const PatientReg = () => {
  return (
    <div>
      <form>
        <div className="row">
          <div className="col-md-6 mb-1">
            <input type="text" placeholder="First Name"/>
          </div>
          <div className="col-md-6 mb-1">
            <input type="text" placeholder="Last Name"/>
          </div>         
        </div>
      
      
      </form>
    </div>
  );
};

export default PatientReg;
